import React from "react";
import Navbar from "./components/Navbar";
import { Switch, Route } from "react-router-dom";
import HomeScreen from "./components/HomeScreen";
import Login from "./components/Login";
import SignUp from "./components/SignUp";
import WannaJoin from "./components/WannaJoin";
import ContactUs from "./components/ContactUs";
import About from "./components/About"
const Home = () => {
  return (
    <>
      <Navbar />

    </>
  );
};



const Service = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Thapa Technical Service Page</h1>
      </section>
    </>
  );
};

const Contact = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Thapa Technical Contact Page</h1>
      </section>
    </>
  );
};

const App = () => {
  return (

    <Switch>
<Route path="/signup">
        <SignUp />
      </Route>
      <Route path="/howorks">
        <HomeScreen />
      </Route>
<Route path="/login">
        <Login />
        </Route>
<Route path="/join">
        <WannaJoin />
      </Route>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/home">
        <HomeScreen />
      </Route>
      <Route path="/about">
        <About />
      </Route>   <Route path="/Contact">
        <ContactUs />
      </Route>

      <Route path="/service">
        <Service />
      </Route>

      <Route path="/contact">
        <Contact />
      </Route>
    </Switch>
  );
};

export default App;
